import React, { Component } from 'react';

class Home extends Component {

  render() {
    return (
      <div className="home col-md-12">
        <div className="d-flex justify-content-between home-nav">
          <div className="">
            <h1>Starlify</h1>
          </div>
          <div className="">
            <p>Sign in</p>
          </div>
        </div>
        <div className="banner-content-wrapper row align-items-center">
          <div className="banner-content">
            <h2>Unite your application<br />network with Starlify</h2>
            <button type="button" class="btn btn-primary">Primary</button>
            <button type="button" class="btn btn-primary">Primary</button>
          </div>
        </div>
      </div>
    )
  }
}

export default Home;
